/*
 * https://leetcode.com/problems/longest-substring-without-repeating-characters/
 * move two pointers thru the code, creating substring between the two.
 * if the next character is not within that string, add and continue.
 */

 /**
 * @param {string} s
 * @return {number}
 */
var lengthOfLongestSubstring = function(s) {
  var count = 0;
  if(s.length < 1) return 0;
  for(var c=0; c<s.length; c++ ) {
    for(var nc=c; nc<=s.length; nc++) {
        if(s.substring(c,nc).indexOf(s[nc])!==-1 || !s[nc]) {
          count = (nc-c > count) ? nc-c : count;
          break;
        }
    }
  }
  return count;
};



